pub fn get_duckdb_root_grammar_id() -> GrammarId {
    GrammarId(4264)
}
pub fn get_duckdb_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_duckdb_root_grammar_id(),
        tables: &DUCKDB_TABLES,
    }
}
pub fn get_duckdb_root_grammar() -> RootGrammar {
    get_duckdb_root_grammar_table()
}
